export const _newNote = (object) => {
    return fetch("http://localhost:8000/new-note/", {
        method: "POST",
        headers: {
            Accept: "application/json",
            "Content-Type": "application/json"
        },
        body: JSON.stringify(object)
    }).then(res => res.json());
};
